import axios from "axios"
import React  from "react"

const url = "http://localhost:8000/artists"
function Freelances() {
	const [post, setPost] = React.useState(null);

	React.useEffect(() => {
		axios.get(url).then((response) => {
			setPost(response.data);
		})
	}, [])
	if (!post) 
		return null;
    console.log(post)

	if(post){
		const tab = [];
		for(let i = 0; i < 20;i++){
			tab.push(
				<div style={{
					display: 'flex',
					flexDirection: 'column',
					width: '400px'
					}}>
					<img src={post[i].photo} alt="" />
					<h3>{post[i].name}</h3>
					<h6 style={{
						margin: '0'
					}}>{post[i].description}</h6>
					<p style={{
						fontSize: 'xx-small'
					}}>{post[i].bio}</p>
				</div>
			);
		}
	}
    return(

		<div style={{
			display: 'flex',
			flexDirection: 'row',
			flexWrap: 'wrap',
			gap: '16px',
			justifyContent: 'center'
		  }}>


		</div>
    )
}

export default Freelances
